import { useEffect } from "react";
import PlacesCard from "./PlacesCard";
import {
  Box,
  Typography,
  Button,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Chip,
  Grid,
} from "@material-ui/core";

const PlacesContainer = ({ savedPlaces, setSavedPlaces }) => {
  useEffect(() => {
    fetch("/places").then((res) => {
      if (res.ok) {
        res.json().then((data) => setSavedPlaces(data));
      } else {
        res.json().then((errors) => console.log(errors));
      }
    });
  }, []);

  const mapSavedPlaces = savedPlaces.map((myPlace) => {
    return (
      <PlacesCard
        key={myPlace.id}
        id={myPlace.id}
        name={myPlace.name}
        location={myPlace.location}
        rating={myPlace.rating}
      />
    );
  });

  return (
    <div>
      <Typography gutterBottom variant="h5">
        My Places
      </Typography>
      <Grid container>{mapSavedPlaces}</Grid>
    </div>
  );
};

export default PlacesContainer;
